import React from 'react';
import {Component} from 'react';
import Pictures from "./Pictures"
import AboutMe from "./AboutMe"
import './App.css';
import { entries } from './EntriesData.js'
import { Navbar, NavDropdown, Nav, Form, FormControl, Button } from 'react-bootstrap';

import { makeStyles } from '@material-ui/core/styles';
import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
    paddingBottom: 100
  }
}));

class App {
  render(){
    return (

          <Router>
            <p>
              <section className = "Welcome-text">
                <h1><strong>Hey, I'm Noah Saldaña</strong></h1>
                <section className = "Welcome-sub">
                  <p>iOS Developer - Student Mentor - Human-Centered Designer</p>
                </section>
                <section className = "Nav">
                  <Link to="/projects">Projects</Link>
                  <Link to="/aboutme">About Me</Link>
                </section>
                <section>
                  <GridList cellHeight={750} className="Profile-image" cols={1} alignItems="flex-end">
                    <GridListTile key={"test"} cols={1|| 1}>
                          <img src={"https://noahsaldanadesign.com/img/IMG_3958.jpg"} alt={"test"}/>
                    </GridListTile>
                  </GridList>
                </section>
              </section>
            </p>
            <Switch>
              <Route path="/projects">
                <ProjectsPage />
              </Route>
              <Route path="/aboutme">
                <AboutMePage />
              </Route>
            </Switch>
        </Router>
    );
  }
}
export default App;

function ProjectsPage() {
  return <div className="App">
  <header className="App-header">
    <section id = "Pictures">

      {entries.map((entry)=>(
        <Pictures
        key = {entry.name}
        name = {entry.name}
        link = {entry.link}
        description = {entry.description}
        />
      ))}
    </section>
  </header>
  </div>;
}

function AboutMePage() {
  return <div>
    <AboutMe />
  </div>
}
